package entity;

// TODO: Auto-generated Javadoc
/**
 * The Class Page.
 */
public class Page {
	
	/** The title. */
	private String title;
	
	/** The ns. */
	private int ns;
	
	/** The pageid. */
	private int pageid;
	

	/**
	 * Gets the title.
	 *
	 * @return the title
	 */
	public String getTitle() {
		return title;
	}

	/**
	 * Sets the title.
	 *
	 * @param title the new title
	 */
	public void setTitle(String title) {
		this.title = title;
	}

	/**
	 * Gets the ns.
	 *
	 * @return the ns
	 */
	public int getNs() {
		return ns;
	}

	/**
	 * Sets the ns.
	 *
	 * @param ns the new ns
	 */
	public void setNs(int ns) {
		this.ns = ns;
	}

	/**
	 * Gets the pageid.
	 *
	 * @return the pageid
	 */
	public int getPageid() {
		return pageid;
	}

	/**
	 * Sets the pageid.
	 *
	 * @param pageid the new pageid
	 */
	public void setPageid(int pageid) {
		this.pageid = pageid;
	}

}
